tables.table_schema:
CREATE TABLE Tree (
    tree_id INT PRIMARY KEY,
    tree_name VARCHAR(50),
    tree_species VARCHAR(50),
    plantation_date DATE
);

CREATE TABLE TreeInventory (
        inventory_id INT PRIMARY KEY,
        tree_id INT,
        species VARCHAR(50),
        planted_date DATE
);

CREATE TABLE TreeHealth (
        health_id INT PRIMARY KEY,
        tree_id INT,
        health_description TEXT,
        health_rating INT
);
